import React, { Component} from 'react';
import  InputRange  from './InputSlider';


class noValueSlider extends Component {
    constructor(props) {
        super(props)
        this.state = {
            value: [
                {
                value: 0
                },
                {
                value2: 50
                },
                {
                value3: 100
                }
            ]
        }
    }
    render() {
        return (
            <form className="form">                
                <InputRange min={0} max={100} value={50} />
            </form>
        );
    }
}


export default noValueSlider;
